import { Grid, IconButton, Menu, MenuItem } from '@material-ui/core'
import React from 'react'
import {Menu as MenuIcon} from '@material-ui/icons'


const SettingsMenu: React.FC = () => {

    const [menuAnchor, setMenuAnchor] = React.useState<HTMLElement | null>(null)

    const handleShowMenu = React.useCallback((e: React.MouseEvent<HTMLElement>) =>{
        setMenuAnchor(e.currentTarget)
    },[])

    const handleHideMenu = React.useCallback(() =>{
        setMenuAnchor(null)
    },[])

    return(
        <Grid
            container>
            <IconButton onClick = {handleShowMenu}>
                <MenuIcon/>
            </IconButton>
            <Menu
                keepMounted
                open = {Boolean(menuAnchor)}
                anchorOrigin={{
                    vertical: 'bottom',
                    horizontal: 'right',
                }}
                // transformOrigin={{
                //     vertical: 'top',
                //     horizontal: 'right',
                // }}
                onClose = {handleHideMenu}>
                <MenuItem>
                    Test
                </MenuItem>
            </Menu>
        </Grid>
    )

} 

export default SettingsMenu
